//Main about section container - Contains personal details and content
.about {
    min-height: 100vh;
    background-color: #010304;

    //Set grid
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: 1fr;

    //Change grid layout for 600px and below
    @media only screen and (max-width: 800px) {
        grid-template-rows: repeat(2, 1fr);
        padding: 5rem;
    }


    //Description of developer
    &__desc {
        font-size: 1.6rem;
        font-weight: 300;
        margin-top: 2rem;
    }

    //Overview details
    &__overview {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: baseline;
        position: relative;
        left: 25%;


        //Change grid postion for 600px and below
        @media only screen and (max-width: 800px) {
            grid-row: 1 / 2;
            grid-column: 1 / -1;
            left: 0;
        }

        //Icon container
        &--icons {
            margin-top: 4rem;
            display: flex;
            justify-content: start;

        }

        //Individual icons
        &--icon {
            height: 3rem;
            width: 3rem;
            fill: white;
            margin-right: 1rem;
            transition: all .2s
        }

        //Set hover properties
        &--icon:hover {
            fill: #ffb129;
            cursor: pointer;
        }
    }


    //Name section
    &__title {
        font-size: 5rem;
        font-weight: 100;

        //Split name into two rows
        &--top {
            display: block;

        }

        &--bottom {
            display: block;

        }


    }

